import React, { useContext, useEffect } from "react";
import { LoadingContext } from "./../store/Store";
function Index() {
  const [, setLoading] = useContext(LoadingContext);
  useEffect(() => {
    setLoading(false);
  });

  return (
    <div className="wrapper">
      <div className="container-fluid">
        <div className="row">
          <div class="col-xl-3 col-md-6">
          <div class="card"><img class="card-img-top img-fluid" src="assets/images/small/img-3.jpg" alt="Card image cap" /><div class="card-body"><p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p></div></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Index;
